int fs_print(wchar_t *str, int x, int y, int color, int maxWidth) {
	int len = wcslen ( str );
	if (len > 300) {
		return -1;
	}
	int i = 0, k = 0, offsetX = x, offsetY = y;
	for (i = 0; i < len; i++) {
		wchar_t c = str[i];
		for (k = 0; k < fs_size; k++) {
			if (fs_chars[k] == c) {
				offsetX += fs_ptr[k](offsetX, offsetY, color);
			}
		}
	}
}